import {BrowserRouter,Routes,Route} from 'react-router-dom'

import AddTask from './pages/AddTask';
import SelfTask from './pages/SelfTask';
import AssignedBy from './pages/AssignedBy';
import AssignedTo from './pages/AssignedTo';
import SharedLayout from './pages/SharedLayout';
import LoginPage from './pages/LoginPage';
function App() {


  return (
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<LoginPage/>}/>

          <Route path='/addtask' element={<AddTask/>}/>
          <Route path='/self' element={<SelfTask/>}/>
          <Route path='/by' element={<AssignedBy/>}/>
          <Route path='/to' element={<AssignedTo/>}/>

        </Routes>
      </BrowserRouter>
  );
}

export default App;
